import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Paper,
  Grid,
  Tooltip,
  LinearProgress,
  Chip,
  IconButton,
  Link,
  CircularProgress,
} from '@mui/material';
import {
  Security as SecurityIcon,
  CheckCircle as CheckCircleIcon,
  Warning as WarningIcon,
  Error as ErrorIcon,
  InfoOutlined as InfoIcon,
  OpenInNew as OpenInNewIcon,
} from '@mui/icons-material';
import axios from 'axios';

const SecurityIndicator = ({ status, label, description, value, severity }) => {
  const getStatusColor = () => {
    switch (severity) {
      case 'high':
        return {
          bg: 'error.lighter',
          border: 'error.light',
          text: 'error.main',
          icon: <ErrorIcon fontSize="small" />
        };
      case 'medium':
        return {
          bg: 'warning.lighter',
          border: 'warning.light',
          text: 'warning.main',
          icon: <WarningIcon fontSize="small" />
        };
      case 'low':
        return {
          bg: 'success.lighter',
          border: 'success.light',
          text: 'success.main',
          icon: <CheckCircleIcon fontSize="small" />
        };
      default:
        return {
          bg: 'grey.100',
          border: 'grey.300',
          text: 'text.secondary',
          icon: <InfoIcon fontSize="small" />
        };
    }
  };

  const colors = getStatusColor();

  return (
    <Paper
      elevation={0}
      sx={{
        p: 2,
        bgcolor: colors.bg,
        border: 1,
        borderColor: colors.border,
        borderRadius: 2,
        position: 'relative',
        overflow: 'hidden'
      }}
    >
      <Box sx={{ 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between',
        mb: 1
      }}>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <Box sx={{ color: colors.text }}>
            {colors.icon}
          </Box>
          <Typography variant="subtitle2" sx={{ fontWeight: 600, color: colors.text }}>
            {label}
          </Typography>
        </Box>
        <Tooltip title={description} arrow placement="top">
          <IconButton size="small" sx={{ color: colors.text }}>
            <InfoIcon fontSize="small" />
          </IconButton>
        </Tooltip>
      </Box>

      <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
        {status}
      </Typography>

      {value !== undefined && (
        <Box sx={{ mt: 1 }}>
          <Box sx={{ 
            display: 'flex', 
            justifyContent: 'space-between',
            alignItems: 'center',
            mb: 0.5
          }}>
            <Typography variant="caption" color="text.secondary">
              Risk Score
            </Typography>
            <Typography variant="caption" sx={{ fontWeight: 500, color: colors.text }}>
              {value}%
            </Typography>
          </Box>
          <LinearProgress 
            variant="determinate" 
            value={value}
            sx={{
              height: 6,
              borderRadius: 3,
              bgcolor: 'background.paper',
              '& .MuiLinearProgress-bar': {
                bgcolor: colors.text
              }
            }}
          />
        </Box>
      )}
    </Paper>
  );
};

const SecurityReport = ({ pair }) => {
  const [securityData, setSecurityData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchSecurityData = async () => {
      try {
        setLoading(true);
        setError(null);

        if (pair?.address) {
          // Replace with your actual API endpoint
          const response = await axios.get(`https://your-api/security/${pair.address}`);
          setSecurityData(response.data);
        }
      } catch (err) {
        console.error('Error fetching security data:', err);
        setError('Failed to load security information');
      } finally {
        setLoading(false);
      }
    };

    fetchSecurityData();
  }, [pair?.address]);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 3 }}>
        <CircularProgress size={24} />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ p: 3, textAlign: 'center', color: 'error.main' }}>
        <ErrorIcon sx={{ mb: 1 }} />
        <Typography>{error}</Typography>
      </Box>
    );
  }

  // Security checks using the actual pair data
  const securityChecks = {
    mintAuthority: {
      status: pair?.mint_authority ? 'Mint authority is enabled' : 'No mint authority',
      severity: pair?.mint_authority ? 'high' : 'low',
      description: 'Indicates whether new tokens can be minted'
    },
    freezeAuthority: {
      status: pair?.freeze_authority ? 'Freeze authority is enabled' : 'No freeze authority',
      severity: pair?.freeze_authority ? 'medium' : 'low',
      description: 'Indicates whether accounts can be frozen'
    },
    liquidity: {
      status: `$${(pair?.totalLiquidity || 0).toLocaleString()} total liquidity`,
      severity: pair?.totalLiquidity > 100000 ? 'low' : 'medium',
      description: 'Total value locked in the pool',
      value: Math.min((pair?.totalLiquidity || 0) / 1000000 * 100, 100)
    }
  };

  return (
    <Box>
      {/* Header */}
      <Box sx={{ 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between',
        mb: 3
      }}>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
          <SecurityIcon color="primary" />
          <Typography variant="h6" sx={{ fontWeight: 600 }}>
            Security Report
          </Typography>
        </Box>
        <Link
          href={`https://solscan.io/token/${pair?.address}`}
          target="_blank"
          rel="noopener noreferrer"
          sx={{ 
            display: 'flex',
            alignItems: 'center',
            gap: 0.5,
            textDecoration: 'none',
            color: 'primary.main',
            '&:hover': { textDecoration: 'underline' }
          }}
        >
          <Typography variant="caption">View on Solscan</Typography>
          <OpenInNewIcon sx={{ fontSize: 14 }} />
        </Link>
      </Box>

      {/* Security Indicators */}
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <SecurityIndicator 
            label="Mint Authority"
            {...securityChecks.mintAuthority}
          />
        </Grid>
        <Grid item xs={12}>
          <SecurityIndicator 
            label="Freeze Authority"
            {...securityChecks.freezeAuthority}
          />
        </Grid>
        <Grid item xs={12}>
          <SecurityIndicator 
            label="Liquidity"
            {...securityChecks.liquidity}
          />
        </Grid>
      </Grid>

      {/* Overall Security Score */}
      <Box sx={{ mt: 3 }}>
        <Chip
          label={pair?.is_blacklisted ? 'Blacklisted Token' : 'Verified Token'}
          color={pair?.is_blacklisted ? 'error' : 'success'}
          icon={pair?.is_blacklisted ? <WarningIcon /> : <CheckCircleIcon />}
          sx={{ 
            width: '100%',
            py: 2,
            '& .MuiChip-label': {
              fontSize: '0.875rem',
              fontWeight: 500
            }
          }}
        />
      </Box>
    </Box>
  );
};

export default SecurityReport;
